import { Component } from "react";

class SearchBox extends Component {
   render() {

    const {onChangeHandler, placeHolder, className} = this.props

    return (
        <input 
      className={className}
      placeholder={placeHolder}
      type="text" 
      onChange={onChangeHandler}/>
    )
   }
}

export default SearchBox
